const mongoose = require("mongoose");

const userSchema = new mongoose.Schema(
  {
    username: {
      type: String,
      required: true,
      unique: true,
    },
    email: {
      type: String,
      required: true,
      unique: true,
    },
    password: {
      type: String,
      required: true,
    },
    profileInfo: {
      photo: {
        type: String,
        default:
          "",
      },
      description: { type: String, default: "imi place sportul:)" },
      age: { type: Number, default: 0 },
      gender: { type: String, default: "Femeie", enum: ["Brbat", "Femeie"] },
      skillLevel: { type: String, default: "" },
    },
    activityHistory: [String],
    friendList: [{ type: mongoose.Schema.Types.ObjectId, ref: "User" }],
  },
  { collection: "utilizatori" }
);

const User = mongoose.model("User", userSchema);

module.exports = User;
